import Home from "./components/Home";
import { NavLink } from "react-router-dom";

function App() {
  return (
    <div className="">
      <div>
        <NavLink to={"/"} className=" bg-green-700  p-4  rounded-md">
          Anasayfa
        </NavLink>
        <NavLink
          to={"/addwords"}
          className=" bg-green-700 p-4 ml-3  rounded-md"
        >
          Kelime Ekle
        </NavLink>
        <NavLink to={"/words"} className=" bg-green-700 p-4 ml-3 rounded-md">
          Kelimeler
        </NavLink>
      </div>
      <Home />
    </div>
  );
}

export default App;
